;; **
;;; # Example of using linear-regression plot
;;; 
;;; The regression could be automatically done by the plot or you can call the linear-regression function and then plot it using the same lm-plot function.  
;;; 
;;; lm-plot-compose makes it possible to plot many linear-models at once with different colours.
;; **

;; @@
(v/lm-plot-compose (map list (range 200) (map #((rand-nth [+ + + + -]) (* 1.3 %) (rand-int 50)) (range 200)))
                   (map list (range 200) (map #((rand-nth [+ - - - -]) (* 2.3 %) (rand-int 100)) (range 250)))
                   (map list (range 200) (map #((rand-nth [+ - - - -]) (* 0.3 %) (rand-int 80)) (range 300))))
